function SetupFavIcons() {
  const onThemeUpdate = function () {
    const favicon = document.head.querySelector("#favicon");
    if (SystemTheme.shared.dark == true) {
        favicon.href = "assets/icons/favicon_dark.png";
    } else {
        favicon.href = "assets/icons/favicon_light.png";
    }
  };

  onThemeUpdate();

  NotificationCenter.default.addObserver(
    SystemTheme.Notifications.Changed,
    null,
    onThemeUpdate
  );
}

const svgNS = "http://www.w3.org/2000/svg";

function SVGCanvasOfSize(width, height, children) {
  var canvas = document.createElementNS(svgNS, "svg");
  canvas.setAttributeNS(null, "width", width);
  canvas.setAttributeNS(null, "height", height);
  canvas.setAttributeNS(null, "viewBox", "0 0 " + width + " " + height);
  if (children != null) {
    var childEnumerator = (parent, children) => {
      children.forEach((child) => {
        var kind = child.kind;
        var element = document.createElementNS(svgNS, kind);
        parent.appendChild(element);

        var attributes = child.attributes;
        if (attributes != null) {
          for (var key in attributes) {
            var value = attributes[key];
            element.setAttributeNS(null, key, value);
          }
        }
        var descendents = child.children;
        if (descendents != null) {
          childEnumerator(element, descendents);
        }
      });
    };
    childEnumerator(canvas, children);
  }
  return canvas;
}

