    _SlideThumbnailPresenterGradient(width, height, paint) {
        // Don't hardcode the border width, calculate it based on the height
        const borderWidth = (2 / 90) * height;
        const defs = {
            kind: "defs",
            children: [
                {
                    kind: "linearGradient",
                    attributes: {
                        id: "a",
                        x1: width / 2,
                        x2: width / 2,
                        y1: 0,
                        y2: height,
                        gradientUnits: "userSpaceOnUse",
                    },
                    children: [
                        {
                            kind: "stop",
                            attributes: {
                                "stop-color": "#1A1A1A"
                            },
                        },
                        {
                            kind: "stop",
                            attributes: {
                                "stop-color": "#404040",
                                offset: "1",
                            },
                        }
                    ],
                },
                {
                    kind: "linearGradient",
                    attributes: {
                        id: "b",
                        x1: width / 2,
                        x2: width / 2,
                        y1: height * .2,
                        y2: height,
                        gradientUnits: "userSpaceOnUse",
                    },
                    children: [
                        {
                            kind: "stop",
                            attributes: {
                                "stop-color": "#B8B8B8"
                            },
                        },
                        {
                            kind: "stop",
                            attributes: {
                                "stop-color": "#4D4D4D",
                                offset: "1",
                            },
                        }
                    ],
                },
                {
                    kind: "linearGradient",
                    attributes: {
                        id: "c",
                        x1: width / 2,
                        x2: width / 2,
                        y1: (height * .2) + borderWidth,
                        y2: height - borderWidth,
                        gradientUnits: "userSpaceOnUse",
                    },
                    children: [
                        {
                            kind: "stop",
                            attributes: {
                                "stop-color": "#5D5D5D"
                            },
                        },
                        {
                            kind: "stop",
                            attributes: {
                                "stop-color": "#414141",
                                offset: "1",
                            },
                        }
                    ],
                },
            ],
        };

        if (paint != null && (paint.type == "linear" || paint.type == "radial")) {
            defs.children.push(AppIcons._PaintToGradient(paint, "bgcolor", width, height));
        }

        return defs;
    },

    _SlideThumbnailPresenterFill(paint) {
        if (paint == null) {
            // default gradient
            return "url(#a)";
        } else if (paint.type == "color") {
            // solid color
            return paint.toCSS();
        } else {
            // gradient, see above
            return "url(#bgcolor)";
        }
    },

    _PaintToGradient(paint, id, width, height) {
        const result = {
            kind: `${paint.type}Gradient`,
            attributes: {
                id,
                gradientUnits: "userSpaceOnUse",
            },
            children: [
            ],
        };

        paint.colors.forEach((color, index) => {
            result.children.push({
                kind: "stop",
                attributes: {
                    offset: index,
                    "stop-color": Color(...color),
                }
            });
            if (paint.type == "linear") {
                const point = paint.points[index];
                result.attributes[`x${index+1}`] = point[0] * width;
                result.attributes[`y${index+1}`] = point[1] * height
            }
        });

        return result;
    },

